import { useState } from 'react';
import LoggedIn from "./LoggedIn";

function Home() {
    const [islogged, setIsLogged] = useState(false);
    useEffect(() => {
    if (window.localStorage.getItem('Item') === null) {
        setIsLogged(true);
    }
});
    const renderLoogedOut = (
        <>
        <p>Welcome</p>
        </>
    );
    return (
        <>
            {islogged ? <LoggedIn /> : renderLoogedOut}
        </>
    );
}

export default Home;
